import React from "react";

const Sresult = (props) => {
  const pics = `https://source.unsplash.com/500x500/?${props.lol}`;
  return (
    <div className="container-fluid text-center" style={{ marginTop: "20px" }}>
      <img className="container-fluid w-25" src={pics} alt="results" />
    </div>
  );
};

export default Sresult;
